class footerLinks{
    constructor(linkName, url){
        this.linkName = linkName;
        this.url = url;
    }
}

const Footer = () => {
    return(
        <div className='footer-container'>
            <div className='another-links'>
                <ul>
                    <li>One</li>
                    |
                    <li>One</li>
                    |
                    <li>One</li>
                    |
                    <li>One</li>
                    |
                    <li>One</li>
                </ul>
            </div>
        </div>
    )
}

export default Footer;
